<script>
	import uCharts from '@qiun/ucharts';
	var uChartsInstance = {};
	export default {
		data() {
			return {
				cWidth: 642,
				cHeight: 540
			};
		},
		onReady() {
			this.cWidth = uni.upx2px(580);
			//这里的 500 对应 css .charts 的 height
			this.cHeight = uni.upx2px(502);
			this.getServerData();
		},
		methods: {
			getServerData() {
				//模拟从服务器获取数据时的延时
				setTimeout(() => {
					let res = {
						categories: ["2016", "2017", "2018", "2019", "2020", "2021"],
						series: [{
								name: "完成量",
								data: [18, 27, 21, 24, 6, 28],
								type: 'line',
								style: 'curve', //这里的类型改成曲线 curve  默认是 straight直线
								color: '#1890ff'
							}

						]
					};
					this.drawCharts('myid', res);
				}, 500);
			},
			drawCharts(id, data) {
				const ctx = uni.createCanvasContext(id, this);
				uChartsInstance[id] = new uCharts({
					legend: {
						show: false
					},
					type: "mix",
					context: ctx,
					width: this.cWidth,
					height: this.cHeight,
					categories: data.categories,
					series: data.series,
					xAxis: {
						disableGrid: true
					},
					yAxis: {
						data: [{
							min: 0
						}]
					},
					extra:{
						mix:{
							column:""
						}
					}
				});
			},
			tap(e) {
				uChartsInstance[e.target.id].touchLegend(e);
				uChartsInstance[e.target.id].showToolTip(e);
			},
			back(){
				uni.navigateBack({
					delta:2
				})
			},
			jumToHealthEdit(){
				uni.navigateTo({
					url:'/pages/headlthedit/headlthedit'
				})
			},
			back(){
				uni.navigateBack({
					delta:2
				})
			}
		}
	};
	

</script>
